import styled from 'styled-components';
import {Blueprint, Container, Title1, Ps4Controller} from '../index';

const BodyCircleLeft = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #fff;
    border-radius: 50%;
    position: absolute;
    bottom: 0;
    left: 0;
`;

const BodyCircleRight = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #fff;
    border-radius: 50%;
    position: absolute;
    bottom: 0;
    right: 0;
`;
class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Container>
                <Blueprint>
                    <Ps4Controller>
                        <BodyCircleRight></BodyCircleRight>
                        <BodyCircleLeft></BodyCircleLeft>
                    </Ps4Controller>
                </Blueprint>
            </Container>
        );
    }
}

export default Main;
